import React from 'react';
import styles from './styles.css'; // Import CSS module for styling

const SocialMedia = () => {
  const handleLinkedInClick = () => {
    window.open('', '_blank');
  };

  const handleInstagramClick = () => {
    window.open('https://www.instagram.com/your_company/', '_blank');
  };

  const handleFacebookClick = () => {
    window.open('https://www.facebook.com/aisha.katwesige.3/', '_blank');
  };

  return (
    <div className={styles.socialMedia}>
      <h3>Follow Us</h3>
      <div className={styles.icons}>
        <img
          src="/images/linkden.png"
          alt="LinkedIn"
          onClick={handleLinkedInClick}
        />
        <img
          src="/images/insta.png"
          alt="Instagram"
          onClick={handleInstagramClick}
        />
        <img
          src="/images/facebk.png"
          alt="Facebook"
          onClick={handleFacebookClick}
        />
      </div>
    </div>
  );
}

export default SocialMedia;
